import React from 'react';
import ReactDOM from 'react-dom/client';



class Router extends React.Component {


  findColor() {
    for (let i = 0; i < list.length; i++) {
      if (list[i] >= 95) {
        return "red";
      }
    }
  }

  render() {

    const routerInfoList = [
      { id: 0, type: "NPU-1", usage: 94 },
      { id: 1, type: "NPU-0", usage: 70 },
      { id: 2, type: "NPU-0", usage: 2 },
      { id: 3, type: "NPU-1", usage: 35 },
      { id: 4, type: "NPU-0", usage: 99 }
    ];

    let list = routerInfoList.map(
      (el) => {
        return el.usage
      }
    );



    return (
      <div>
        <p>{list}</p>
        <p>{this.findColor.bind(this)}</p>
      </div>
    )
  }
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<Router />);
